import './Bookshelf.css';
import React from 'react';

export default function Bookshelf() {
    return(
        <div>
            <div className='menu'>
                <p className='helloWorld'>내 서재</p>
                <div className='bookshelf'>
                    <img className='books' src='img/마당을 나온 암탉 표지.png' alt='마당을 나온 암탉'/>
                </div>
            </div>
        </div>

    )
}
